import './PopupMenu.css'

function PopupMenu(props) {

  return (
    <div className={`popup ${props.isOpen ? 'popup_opened' : ''}`}>
      <div className='conteiner__menu'>
        <ul className='navigation__links'>
          <li className='navigation__link'>Главная</li>
          <li className='navigation__link'>Фильмы</li>
          <li className='navigation__link'>Сохранённыё</li>
        </ul>
        <button className='navigation__account'>Аккаунт</button>
      </div>
    </div>
  )
}

export default PopupMenu;
